import React from "react";

import './Logo.css'
import { Link } from "react-router-dom";

const Logo = () => {
    return <div className="logo hoverable">
        <Link to="/">
            <img src="./assets/images/reddit_logo_red.png"/>
            <span>reddit</span>
        </Link>

    </div>
}

export default Logo
